import React from "react";

const StarF = (n) => {
  const startab = [];
  for (let i = 1; i <= n; i++) {
    if (i <= n) startab.push(<span style={{ color: "orange" }}> ★ </span>);
    else startab.push(<span style={{ color: "black" }}> ★ </span>);
  }
  return startab;
};

function StarRating({ rate }) {
  return <div>{StarF({ rate })}</div>;
}

export default StarRating;
